text.autoconfig.bole.option.bannedEntity:
If you really hate some features in the handbook, you can write the
corresponding request IDs of the features here to ban them.
How to get a request ID:
1. Open the handbook screen and press [Right ALT] to enable debug mode;
2. Make sure you meet the requirements of the button;
3. Press the button you hate and the request ID will be printed.
